import SignupForm from "../components/SignupForm";
import Submit from '../components/Submit'
import { Routes,Route } from "react-router-dom";
function Signup() {
    return (
        <>
        <SignupForm />
        <Routes>
        <Route path='/submit' element={<Submit/>}/>
            </Routes>
            </>
    )
}
export default Signup;
